      out.write("\t\t<!-- 文章标题 -->\r\n");
      out.write("\t\t<div class=\"row\">\r\n");
      out.write("\t\t\t<h3>A股三大指数缩量收跌：创业板指跌1% 可转债行情持续火爆</h3>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\r\n");
      out.write("\t\t<!-- 文章发表时间和文章来源 -->\r\n");
      out.write("\t\t<div class=\"row\">\r\n");
      out.write("\t\t\t<p class=\"graytext\">2020年10月22日 15:00 | 来源：东方财富研究中心</p>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\r\n");
      out.write("\t\t<!-- 正文 ，包括图片和文字 -->\r\n");
      out.write("\t\t<div class=\"row\">\r\n");
      out.write("\t\t\r\n");
      out.write("\t\t\t<p>　　A股三大指数今日延续弱势表现，最终集体收跌，其中沪指下跌0.38%，收报3312.50点；深成指下跌0.53%，收报13396.18点；创业板指跌幅达到1%，收报2673.59点。市场成交量萎缩，两市合计成交6637亿元，行业板块涨少跌多，酿酒板块领涨，疫苗板块领跌，券商板块尾盘异动。北向资金今日净卖出27.48亿元。</p>\r\n");
      out.write("\t\t</div>\r\n");
      out.write("\t\t<div class=\"row\">\r\n");
